import React from 'react'
import "./hotel.css"
import Navbar from '../../components/navbar/Navbar'
import Header from '../../components/header/Header'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  // faCircleArrowLeft,
  // faCircleArrowRight,
  // faCircleXmark,
  faLocationDot,
} from "@fortawesome/free-solid-svg-icons";
const Hotel = () => {
  const photos = [
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261707778.jpg?k=56ba0babbcbfbeb3d3e911728831dc"
    },
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261707367.jpg?k=cbacfdeb8404f56a1a94812575d96e"
    },
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261707845.jpg?k=1aae4678d645c63ed90cdac8127b11"
    },
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261707776.jpg?k=54bb3e27c9e58d3bb1111349eb5e6c"
    },
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261708693.jpg?k=ea210b4fa329fe302eab55dd9818dc"
    },
    {
      src: "https://cf.bstatic.com/xdata/images/hotel/max1280x900/261707389.jpg?k=52156673f9eb6d5d99d3eed9386491"
    }
  ];
  
  return (
    <div>
      <Navbar/>
      <Header type="list"/>
      <div className="hotelContainer">
      <div className="hotelWrapper">
      <h1 className="hotelTitle">data.name</h1>
            <div className="hotelAddress">
              <FontAwesomeIcon icon={faLocationDot} />
              <span>data.address</span>
            </div>
            <span className="hotelDistance">
              Excellent location  data.distance m from center
            </span>
            <span className="hotelPriceHighlight">
              Book a stay over data.cheapestPrice at this property and get a
              free airport taxi
            </span>
            <div className="hotelImages">
               {photos.map(photo=>(
                <div className="hotelImgWrapper">
                  
                </div>
               ))}
              </div>
    </div>
    </div>
    </div>
  )
}

export default Hotel
